import { Button, TextField } from "@mui/material";
import React, { useState } from "react";

function LoginPage({ setLoginInfo }) {
  const [userName,setUserName]=useState("")
  const [password,setPassword]=useState("")
  return (
    <div className="grid justify-center gap-2 mt-16">
      <TextField name="userName" label="User Name" size="small" onChange={(e)=>setUserName(e.target.value)} />
      <TextField name="password" label="Password" size="small" onChange={(e)=>setPassword(e.target.value)} />
      <Button type="button" variant="contained">
        Login 
      </Button>
    </div>
  );
}

export default LoginPage;
